tation du traitement conformément à l\'art. 18 RGPD : tu as le droit de demander la limitation du traitement de tes données personnelles pendant que nous vérifions l\'exactitude des données que tu contestes, si tu refuses la suppression de tes données en raison d\'un traitement illicite et demandes à la place la limitation, si tu as besoin des données pour la constatation, l\'exercice ou la défense de droits en justice après que nous n\'en ayons plus besoin aux fins prévues ou si tu t\'es opposé pour des raisons liées à ta situation particulière tant qu\'il n\'est pas établi que nos motifs légitimes prévalent ;\n\n- Droit à l\'information conformément à l\'art. 19 RGPD : si tu as fait valoir auprès du responsable le droit de rectification, de suppression ou de limitation du traitement, celui-ci est tenu de communiquer cette rectification ou suppression de données ou limitation du traitement à tous les destinataires auxquels les données personnelles te concernant ont été divulguées, sauf si cela s\'avère impossible ou implique un effort disproportionné. Tu as le droit d\'être informé sur ces destinataires.\n\n- Droit à la portabilité des données conformément à l\'art. 20 RGPD : tu as le droit de recevoir les données personnelles que tu nous as fournies dans un format structuré, couramment utilisé et lisible par machine, ou de demander leur transmission à un autre responsable, dans la mesure où cela est techniquement possible ;\n\n- Droit de retirer les consentements accordés conformément à l\'art. 7 al. 3 RGPD : tu as le droit de retirer à tout moment, avec effet pour l\'avenir, un consentement donné au traitement des données. En cas de retrait, nous supprimerons immédiatement les données concernées, à condition qu\'un traitement ultérieur sans consentement ne puisse pas se fonder sur une base juridique. Le retrait n\'affecte pas la licéité du traitement effectué jusqu\'au retrait ;\n\n- Droit de réclamation conformément à l\'art. 77 RGPD : si tu estimes que le trait